import React, { useEffect, useState } from "react";
import axios from "axios";
import { supabase } from "../../lib/supabase";

const BACKEND_URL = process.env.REACT_APP_BACKEND_URL;

function AdminFacilities() {
  const [facilities, setFacilities] = useState([]);
  const [form, setForm] = useState({
    name: "",
    description: "",
    capacity: "",
    is_paid: false,
    fee: "",
    open_time: "",
    close_time: "",
    slot_duration_minutes: 60
  });

  useEffect(() => {
    fetchFacilities();
  }, []);

  const fetchFacilities = async () => {
    const {
      data: { session }
    } = await supabase.auth.getSession();

    const res = await axios.get(`${BACKEND_URL}/facilities`, {
      headers: { Authorization: `Bearer ${session.access_token}` }
    });

    setFacilities(res.data);
  };

  const handleCreate = async () => {
    const {
      data: { session }
    } = await supabase.auth.getSession();

    await axios.post(`${BACKEND_URL}/facilities`, form, {
      headers: { Authorization: `Bearer ${session.access_token}` }
    });

    alert("Facility created!");
    fetchFacilities();
  };

  const deactivateFacility = async (id) => {
    const {
      data: { session }
    } = await supabase.auth.getSession();

    await axios.patch(
      `${BACKEND_URL}/facilities/${id}/deactivate`,
      {},
      { headers: { Authorization: `Bearer ${session.access_token}` } }
    );

    fetchFacilities();
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>Admin Facility Management</h2>

      {/* Create Facility Form */}
      <div style={{ marginBottom: "30px" }}>
        <h3>Create New Facility</h3>

        <input
          placeholder="Name"
          onChange={(e) => setForm({ ...form, name: e.target.value })}
        />
        <input
          placeholder="Description"
          onChange={(e) => setForm({ ...form, description: e.target.value })}
        />
        <input
          type="number"
          placeholder="Capacity"
          onChange={(e) => setForm({ ...form, capacity: e.target.value })}
        />

        <label>
          Paid?
          <input
            type="checkbox"
            onChange={(e) =>
              setForm({ ...form, is_paid: e.target.checked })
            }
          />
        </label>

        {form.is_paid && (
          <input
            type="number"
            placeholder="Fee"
            onChange={(e) => setForm({ ...form, fee: e.target.value })}
          />
        )}

        <input
          type="time"
          onChange={(e) => setForm({ ...form, open_time: e.target.value })}
        />

        <input
          type="time"
          onChange={(e) => setForm({ ...form, close_time: e.target.value })}
        />

        <input
          type="number"
          placeholder="Slot Duration (minutes)"
          onChange={(e) =>
            setForm({
              ...form,
              slot_duration_minutes: e.target.value
            })
          }
        />

        <button onClick={handleCreate}>Create Facility</button>
      </div>

      {/* Facility List */}
      <h3>Existing Facilities</h3>

      {facilities.map((facility) => (
        <div
          key={facility.id}
          style={{
            border: "1px solid #ccc",
            marginBottom: "10px",
            padding: "10px"
          }}
        >
          <strong>{facility.name}</strong>
          <p>
            {facility.open_time} - {facility.close_time}
          </p>
          <p>Slot: {facility.slot_duration_minutes} mins</p>
          <p>Status: {facility.is_active ? "Active" : "Inactive"}</p>

          {facility.is_active && (
            <button onClick={() => deactivateFacility(facility.id)}>
              Deactivate
            </button>
          )}
        </div>
      ))}
    </div>
  );
}

export default AdminFacilities;
